import {NextPage} from 'next';
import React, {useState} from 'react';

const SignUp: NextPage = () => {
  const [signUpData, setSignUpData] = useState({
    username:'',
    password: '',
    passwordConfirmation: ''
  })
  return (
    <>
      <h1>注册</h1>
      <form>
        <div>
          <div>
            <label>
              用户名
              <input type="text" value={signUpData.username} onChange={e=> setSignUpData({
                ...signUpData,
                username: e.target.value
              })}/>
            </label>
          </div>
          <div>
            <label>
              密码
              <input type="text" value={signUpData.password} onChange={e=> setSignUpData({
                ...signUpData,
                password: e.target.value
              })}/>
            </label>
          </div>
          <div>
            <label>
              确认密码
              <input type="text"  value={signUpData.passwordConfirmation} onChange={e=> setSignUpData({
                ...signUpData,
                passwordConfirmation: e.target.value
              })}/>
            </label>
          </div>
          <div>
            <button type="submit">注册</button>
          </div>
        </div>
      </form>
    </>

  );
};

export default SignUp;
